
public class MultiplyOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 15;
		int b = 19;
		float f1 = 16.5f;
		double d1 = 26.5;
		
		int r1 = a* b;
		float r2 = a * f1;
		double r3 = b * d1;
		
		System.out.println("res1 = " + r1); 
		System.out.println("res2 = " + r2); 
		System.out.println("res3 = " + r3); 
		
		byte b1=18;
		byte b2=10;
		byte b3=(byte)(b1*b2);
		System.out.println(b3);
	}

}
